Okay, I understand the task. I need to create a computational model to predict responder behavior in the ultimatum game, focusing on parameter recovery and accuracy. The model should output a utility score that influences acceptance or rejection. Here's my plan:

**1. Psychological Mechanisms:**

*   **Fairness:** People care about fairness. Offers perceived as unfair are more likely to be rejected, even if it means getting nothing.
*   **Proposer Contribution:** Responder's evaluation of fairness incorporates the relative contribution of the proposer.
*   **Loss Aversion:** People feel the pain of losing something more strongly than the pleasure of gaining something of equal value. Rejection means losing the potential gain.
*   **Social Utility:** People might derive utility (or disutility) from the acceptance or rejection of their offer.
*   **Inequity Aversion:** Participants may reject offers to avoid advantageous inequity, even when it would be financially beneficial to accept them.

**2. Interactions:**

*   Fairness acts as a primary driver. Lower offers are seen as less fair.
*   Relative contribution modulates fairness perception. If the proposer contributed more, a smaller offer may be deemed fairer.
*   Loss aversion creates a hurdle to rejection. The utility of fairness must outweigh the disutility of receiving nothing.
*   Social utility can either reinforce or counteract the fairness calculation. A desire to punish unfairness can increase the likelihood of rejection, while a desire to avoid conflict might decrease it.
* Inequity aversion may add an additive aversion term based on the split received by the responder vs the proposer.

**3. Mathematical Form:**

I'll use a utility-based model. The utility of accepting an offer will be a function of fairness (modulated by contribution), loss aversion, and social utility. The utility will be the sum of these components.

I will construct fairness based on relative contribution from both proposer and responder and the actual offer amount, using the split percentages.

